/**
 * Append a node to a member expression.
 */
export default function appendToMemberExpression(
  member: t.MemberExpression,
  append: t.MemberExpression["property"],
  computed: boolean = false,
): t.MemberExpression {
  member.object = memberExpression(
    member.object,
    member.property,
    member.computed,
  );
  member.property = append;
  member.computed = !!computed;

  return member;
}

import { INHERIT_KEYS } from "../constants/index.ts";
import inheritsComments from "../comments/inheritsComments.ts";
