} from "../validators/generated/index.ts";

function getNameFromLiteralId(id: t.Literal): string {
  if (isNullLiteral(id)) {
    return "null";
  }

  if (isRegExpLiteral(id)) {
    return `/${id.pattern}/${id.flags}`;
  }

  if (isTemplateLiteral(id)) {
    return id.quasis.map(quasi => quasi.value.raw).join("");
  }

  if (id.value !== undefined) {
    return String(id.value);
  }

  return null;
}

function getObjectMemberKey(
  node: t.ObjectProperty | t.ObjectMethod | t.ClassProperty | t.ClassMethod,
): t.Expression | t.PrivateName {
  if (!node.computed || isLiteral(node.key)) {
    return node.key;
  }
}

type GetFunctionNameResult = {
  name: string;
  originalNode: t.Node;
} | null;

export default function getFunctionName(
  node: t.ObjectMethod | t.ClassMethod,
): GetFunctionNameResult;
export default function getFunctionName(
  node: t.Function | t.Class,
  parent: t.Node,
): GetFunctionNameResult;
export default function getFunctionName(
  node: t.Function | t.Class,
  parent?: t.Node,
): GetFunctionNameResult {
  if ("id" in node && node.id) {
    return {
      name: node.id.name,
      originalNode: node.id,
    };
  }

  let prefix = "";

  let id;
  if (isObjectProperty(parent, { value: node })) {
    // { foo: () => {} };
    id = getObjectMemberKey(parent);
  } else if (isObjectMethod(node) || isClassMethod(node)) {
    // { foo() {} };
    id = getObjectMemberKey(node);
    if (node.kind === "get") prefix = "get ";
    else if (node.kind === "set") prefix = "set ";
  } else if (isVariableDeclarator(parent, { init: node })) {
    // let foo = function () {};
    id = parent.id;
  } else if (isAssignmentExpression(parent, { operator: "=", right: node })) {
    // foo = function () {};
    id = parent.left;
  }

  if (!id) return null;

  const name = isLiteral(id)
    ? getNameFromLiteralId(id)
    : isIdentifier(id)
      ? id.name
      : isPrivateName(id)
        ? id.id.name
        : null;
  if (name == null) return null;

  return { name: prefix + name, originalNode: id };
}

import { VISITOR_KEYS } from "../definitions/index.ts";
import type * as t from "../index.ts";

export type TraversalAncestors = Array<{
  node: t.Node;
  key: string;
  index?: number;
}>;

export type TraversalHandler<T> = (
  this: undefined,
  node: t.Node,
  parent: TraversalAncestors,
  state: T,
) => void;

export type TraversalHandlers<T> = {
  enter?: TraversalHandler<T>;
  exit?: TraversalHandler<T>;
};

/**
 * A general AST traversal with both prefix and postfix handlers, and a
 * state object. Exposes ancestry data to each handler so that more complex
 * AST data can be taken into account.
 */
export default function traverse<T>(
  node: t.Node,
  handlers: TraversalHandler<T> | TraversalHandlers<T>,
  state?: T,
): void {
  if (typeof handlers === "function") {
    handlers = { enter: handlers };
  }

  const { enter, exit } = handlers;

  traverseSimpleImpl(node, enter, exit, state, []);
}

function traverseSimpleImpl<T>(
  node: any,
  enter: Function | undefined,
  exit: Function | undefined,
  state: T | undefined,
  ancestors: TraversalAncestors,
) {
  const keys = VISITOR_KEYS[node.type];
  if (!keys) return;

  if (enter) enter(node, ancestors, state);

  for (const key of keys) {
    const subNode = node[key];

    if (Array.isArray(subNode)) {
      for (let i = 0; i < subNode.length; i++) {
        const child = subNode[i];
        if (!child) continue;

        ancestors.push({
          node,
          key,
          index: i,
        });

        traverseSimpleImpl(child, enter, exit, state, ancestors);

        ancestors.pop();
      }
    } else if (subNode) {
      ancestors.push({
        node,
        key,
      });

      traverseSimpleImpl(subNode, enter, exit, state, ancestors);

      ancestors.pop();
    }
  }

  if (exit) exit(node, ancestors, state);
}

import getBindingIdentifiers from "../retrievers/getBindingIdentifiers.ts";
import type * as t from "../index.ts";
/**
 * Check if the input `node` is a binding identifier.
 */
export default function isBinding(
  node: t.Node,
  parent: t.Node,
  grandparent?: t.Node,
): boolean {
  if (
    grandparent &&
    node.type === "Identifier" &&
    parent.type === "ObjectProperty" &&
    grandparent.type === "ObjectExpression"
  ) {
    // We need to special-case this, because getBindingIdentifiers
    // has an ObjectProperty->value entry for destructuring patterns.
    return false;
  }

  const keys = getBindingIdentifiers.keys[parent.type];
  if (keys) {
    for (let i = 0; i < keys.length; i++) {
      const key = keys[i];
      const val =
        // @ts-expect-error key must present in parent
        parent[key];
      if (Array.isArray(val)) {
        if (val.includes(node)) return true;
      } else {
        if (val === node) return true;
      }
    }
  }

  return false;
}

